import React from "react";
import './EventCard.css';

const EventCard = ({ event }) => {
    const {
        name,
        event_website,
        description
    } = event;
    return (
        <div className="event-card">
            <h2>{event.name}</h2>
            <p>{event.id}</p>
            <p>{event.location}</p>
            <a href={event.registrationLink} target="_blank" rel="noopener noreferrer">Register</a>
        </div>
    );
};

export default EventCard;
